
var PageObject=function(){this.select=element(by.model("model"));this.selectOptions=element.all(by.css("#singleSelection .nya-bs-option"));this.select2=element(by.model("model2"));this.result=element(by.binding("model"));this.result2=element(by.binding("model2"))};describe("Basic Usage",function(){it("should allow user select an element and change the model",function(){var c=new PageObject();browser.get("basic-usage-example-1/index.html");c.select.click();var a=Math.floor(Math.random()*3);expect(c.selectOptions.count()).toBe(3);console.log(a);var b=c.selectOptions.get(a).getAttribute("value");c.selectOptions.get(a).getInnerHtml().then(function(d){console.log(d)});c.selectOptions.get(a).click();expect(b).toEqual(c.result.getText())})});

 
